  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144339 includes discrete
  sample and profile data collected from AURORA AUSTRALIS in the Indian Ocean and
  Southern Oceans (> 60 degrees South) from 1995-07-17 to 1995-09-02. These data include
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential temperature (theta),
  SALINITY, WATER TEMPERATURE, phosphate and silicate. The instruments used to collect
  these data include CTD and bottle.nnThese data were collected by Nathan Bindoff
  of Commonwealth Scientific and Industrial Research Organization as part of the WOCE_SR03_1995
  data set. CDIAC associated the following cruise ID(s) with this data set: WOCE_SR03_1995nnThe
  World Ocean Circulation Experiment (WOCE) was a major component of the World Climate
  Research Program with the overall goal of better understanding the ocean's role
  in climate and climatic changes resulting from both natural and anthropogenic causes.
  The CO2 survey took advantage of the sampling opportunities provided by the WOCE
  Hydrographic Program (WHP) cruises during this period between 1990 and 1998. The
  final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
